import React from "react";

const Login = () => {
  return (
    <div>
      <div className="w-1/3">
        <form action="">
          <div>
            <label htmlFor="username">Username</label>
            <input className="" type="text" name="username" />
          </div>
          <div>
            <label htmlFor="password">Username</label>
            <input type="text" name="password" />
          </div>
        </form>
      </div>
    </div>
  );
};

export default Login;
